import os
import cv2
import albumentations as A
import itertools
from concurrent.futures import ProcessPoolExecutor
import argparse
import random
import numpy as np


#pipeline choisie : (Rotations90_flips|Ø)(Crop|Ø)(Rotation|Ø)(Transformation|Ø)(Couleur|Frères_couleurs|Lumière|Ø)(Flous|Ø)(Bruits|Particules/Objets|Ø)
def generate_transfo(hauteur, largeur, pas_transfo, col):
    #Transformations albumentations

    Rotations_90_flip = [[A.NoOp(p=1.0)],
                         [A.Transpose(p=1.0), A.HorizontalFlip(p=1.0)],
#[A.Rotate(limit=[180,180], p=1.0)],
                         [A.Transpose(p=1.0), A.VerticalFlip(p=1.0)],
                         [A.HorizontalFlip(p=1.0)],
                         [A.Transpose(p=1.0), A.Rotate(limit=[180,180], p=1.0)],
#[A.VerticalFlip(p=1.0)],
                         [A.Transpose(p=1.0)]]
    if pas_transfo==0:
        Rotations_90_flip.pop(0)

    Crop_Move = [[A.NoOp(p=1.0)],
            [A.CenterCrop(height=int(hauteur*0.75), width=int(largeur*0.75), p=1.0)],
            [A.RandomCrop(height=int(hauteur*0.75), width=int(largeur*0.75), p=1.0)],
            [A.Affine(translate_percent=(-0.25, 0.25), fill=col, p=1.0)]]
    if pas_transfo==0:
        Crop_Move.pop(0)

    Rotation=[[A.NoOp(p=1.0)],
              [A.Rotate(limit=45, fill=col, p=1.0)]]
    if pas_transfo==0:
        Rotation.pop(0)

    Transformations=[[A.NoOp(p=1.0)],
                     [A.ChromaticAberration(primary_distortion_limit=0.9, secondary_distortion_limit=0.9, mode='random', interpolation=cv2.INTER_LINEAR, p=1.0)],
                     [A.Downscale(scale_range=(0.1, 0.9), interpolation_pair={'downscale': cv2.INTER_NEAREST, 'upscale': cv2.INTER_LINEAR}, p=1.0)],
                     [A.Emboss(alpha=(0.8, 0.9), strength=(0.8, 1.1), p=1.0)],
                     [A.ImageCompression(quality_range=(5, 30), compression_type='jpeg', p=1.0)],
                     [A.ImageCompression(quality_range=(1, 20), compression_type='webp', p=1.0)],
                     [A.Sharpen(alpha=(0.2, 0.5), lightness=(0.5, 1.0), method='kernel', p=1.0)],
                     [A.ElasticTransform(alpha=40, sigma=40, fill=col, p=1.0)],
                     [A.GridDistortion(num_steps=5, distort_limit=0.1, fill=col, p=1.0)],
                     [A.GridElasticDeform(num_grid_xy=(4, 4), magnitude=2, p=1.0)],
                     [A.LongestMaxSize(max_size=int(max(hauteur,largeur)*0.5))],
                     [A.LongestMaxSize(max_size=int(max(hauteur,largeur)*2))],
                     [A.Morphological(scale=(2, 3), operation='erosion', p=1.0)],
                     [A.Morphological(scale=(2, 3), operation='dilation', p=1.0)],
                     [A.OpticalDistortion(distort_limit=0.3, fill=col, mode='fisheye', p=1.0)],
                     [A.OpticalDistortion(distort_limit=0.3, fill=col, mode='camera', p=1.0)],
                     [A.Perspective(scale=(0.05, 0.2), keep_size=True, fill=col, p=1.0)],
                     [A.ThinPlateSpline(scale_range=(0.1, 0.2), num_control_points=3, fill=col, p=1.0)]]
    if pas_transfo==0:
        Transformations.pop(0)

    Freres_couleur_Couleur_Lumiere = [[A.NoOp(p=1.0)],
                       [A.HueSaturationValue(hue_shift_limit=10, sat_shift_limit=10, val_shift_limit=10, p=1.0)],
                       [A.Illumination(mode='linear', intensity_range=(0.1, 0.2), effect_type='darken', angle_range=(0, 180), p=1.0)],
                       [A.PlanckianJitter(mode="blackbody", temperature_limit=(3000,6000), sampling_method="uniform", p=1.0)],
                       [A.RandomBrightnessContrast(p=1.0)],
    #[A.ChannelDropout(channel_drop_range=(1, 2), fill=0, p=1.0)],
    #[A.ChannelShuffle(p=1.0)],
                       [A.ColorJitter(brightness=(0.9, 1.1), contrast=(0.9, 1.1), saturation=(0.9, 1.1), hue=(-0.05, 0.05), p=1.0)],
                       [A.RGBShift(r_shift_limit=30, g_shift_limit=30,b_shift_limit=30, p=1.0)],
                       [A.Posterize(num_bits=(3,5), p=1.0)]]
    if pas_transfo==0:
        Freres_couleur_Couleur_Lumiere.pop(0)
#Pourquoi les Frères couleur ? Pour ça :
#

    Flou = [[A.NoOp(p=1.0)],
             [A.Defocus(radius=(4, 6), alias_blur=(0.2, 0.4), p=1.0)],
             [A.ZoomBlur(max_factor=1.1, p=1)],
             [A.MedianBlur(blur_limit=(3, 7), p=1.0)],
             [A.MotionBlur(blur_limit=(5,21), p=1.0)],
             [A.GlassBlur(sigma=0.7, max_delta=1, iterations=2, mode="fast", p=1)]]
    if pas_transfo==0:
        Flou.pop(0)

    Bruits_Particules_Objets = [[A.NoOp(p=1.0)],
    #[A.AdditiveNoise(noise_type="gaussian", spatial_mode="shared", noise_params={"mean_range": (0.0, 0.0), "std_range": (0.05, 0.1)},p=1.0)], #redondant avec le gaussien en dessous
                                [A.GaussNoise(std_range=(0.05, 0.1), p=1.0)],
                                [A.SaltAndPepper(amount=(0.05, 0.1), p=1.0)],
                                [A.ShotNoise(scale_range=(0.05, 0.1), p=1.0)],
                                [A.PixelDropout(dropout_prob=0.075, per_channel=True, p=1.0)],
                                [A.RandomFog(fog_coef_range=(0.2, 0.5), alpha_coef=0.1, p=1.0)],
                                [A.RandomGravel(gravel_roi=(0.2, 0.2, 0.8, 0.8), number_of_patches=5, p=1.0)],
                                [A.RandomRain(slant_range=(-15, 15), drop_length=30, drop_width=2, drop_color=(180, 180, 180), blur_value=5, brightness_coefficient=0.8, p=1.0)],
                                [A.RandomShadow(shadow_roi=(0.01, 0.01, 0.99, 0.99), num_shadows_limit=(1, 4), shadow_dimension=5, shadow_intensity_range=(0.1, 0.6), p=1.0)],
                                [A.RandomSnow(snow_point_range=(0.01, 0.4), brightness_coeff=2.0, method="texture", p=1.0)],
                                [A.RandomSunFlare(flare_roi=(0.1, 0, 0.9, 0.3), angle_range=(0.25, 0.75), num_flare_circles_range=(5, 15), src_radius=200, src_color=(255, 200, 100), method="physics_based", p=1.0)],
                                [A.PlasmaShadow(shadow_intensity_range=(0.5, 0.9), roughness=0.3, p=1.0)],
                                [A.CoarseDropout(num_holes_range=(3, 6), hole_height_range=(0.05, 0.1), hole_width_range=(0.05, 0.1), p=1.0)],
                                [A.GridDropout(ratio=0.2, p=1.0)],
                                [A.Erasing(scale=(0.2, 0.5), ratio=(0.5, 2.0), p=1.0)]]
    if pas_transfo==0:
        Bruits_Particules_Objets.pop(0)

    return Rotations_90_flip, Crop_Move, Rotation, Transformations, Freres_couleur_Couleur_Lumiere, Flou, Bruits_Particules_Objets

def apply_transformations(combinaison, picture, output_dir, index, hauteur, largeur):
    augmented_image = picture
    #Solve crop calculated before potential transpose
    if len(combinaison) >1:
        if 'Transpose' in str(combinaison[0][0]) and 'Crop' in str(combinaison[1][0]):
            if 'Center' in str(combinaison[1][0]):
                combinaison[1][0] = A.CenterCrop(height=int(largeur*0.75), width=int(hauteur*0.75), p=1.0)
            else :
                combinaison[1][0] = A.RandomCrop(height=int(largeur*0.75), width=int(hauteur*0.75), p=1.0)
    for list_transform in combinaison :
        for transform in list_transform:
            augmented_image = transform(image=augmented_image)["image"]
    output_image_path = os.path.join(output_dir, f"augmented_{index}.jpg")
    cv2.imwrite(output_image_path, augmented_image)


if __name__ == '__main__':

#Parser
    parser = argparse.ArgumentParser(description='Data augmentation for fish pictures.')
    parser.add_argument('--path', type=str, help='Path to the dataset directory')
    parser.add_argument('--nb', type=int, help='Number of new images to generate per original image')
    parser.add_argument('--same_folder', type=int, choices=[0, 1], default=0, help='1 to save the new images in the same folder as the original image, 0 to create a dedicated folder (default).')
    parser.add_argument('--flips', type=int, choices=[0, 1], default=1, help='Transformations : 1 to add flips and 90° rotations, 0 otherwise')
    parser.add_argument('--crops_move', type=int, choices=[0, 1], default=1, help='Transformations : 1 to add crops and translation, 0 otherwise')
    parser.add_argument('--rotate', type=int, choices=[0, 1], default=1, help='Transformations : 1 to add rotations, 0 otherwise')
    parser.add_argument('--lights_colors', type=int, choices=[0, 1], default=1, help='Transformations : 1 to add lights and colors modifications, 0 otherwise')
    parser.add_argument('--blurs', type=int, choices=[0, 1], default=1, help='Transformations : 1 to add blurs, 0 otherwise')
    parser.add_argument('--noises_objects', type=int, choices=[0, 1], default=1, help='Transformations : 1 to add noise, particles and objects, 0 otherwise')
    parser.add_argument('--transforms', type=int, choices=[0, 1], default=1, help='Transformations : 1 to add miscellaneous transformations, 0 otherwise')
    parser.add_argument('--no_transfo', type=int, choices=[0, 1], default=1, help='Transformations : 1 to add the possibility to skip the transformation in each category (default), 0 otherwise')
    parser.add_argument('--test_mode', type=int, choices=[0, 1], default=0, help='1 : only compute the total number of new images that can be created with current settings')

    args = parser.parse_args()

    dir_list = os.listdir(args.path)

    for dossier in dir_list:    # Explore subfolders
        dossier_path = os.path.join(args.path, dossier)
        if os.path.isdir(dossier_path):    # Ensure it's a directory
            files = os.listdir(dossier_path)    # Assume that data structure is folder>subfolder>files
            for image in files:
                image_path = os.path.join(dossier_path, image)
                if os.path.isdir(image_path):
                    break #Skip if not an image
                im = cv2.imread(image_path)
                if im is None:
                    continue  #Skip if not an image
                h, l= im.shape[:2]
                #couleur moyenne pour le padding quand nécessaire
                img_array = np.array(im)
                avg_color = np.mean(img_array, axis=(0, 1)).astype(np.uint8)
                Rotations_90_flip, Crop_Move, Rotation, Transformations, Freres_couleur_Couleur_Lumiere, Flou, Bruits_Particules_Objets = generate_transfo(h, l, args.no_transfo, avg_color)
                keep=[]
                if args.flips==1:
                    keep.append(Rotations_90_flip)
                if args.crops_move==1:
                    keep.append(Crop_Move)
                if args.rotate==1:
                    keep.append(Rotation)
                if args.transforms==1:
                    keep.append(Transformations)
                if args.lights_colors==1:
                    keep.append(Freres_couleur_Couleur_Lumiere)
                if args.blurs==1:
                    keep.append(Flou)
                if args.noises_objects==1:
                    keep.append(Bruits_Particules_Objets)
                all_transform = list(itertools.product(*keep))
                all_og=len(all_transform)
                if args.test_mode==1:
                    print(f"{all_og} new pictures per image provided can be generated with current settings.")
                    break
                random.shuffle(all_transform)
                if args.nb:
                    all_transform=all_transform[:args.nb]
                    print(f"Generating {len(all_transform)} new pictures of {image} among {all_og} transformations possible.")
                output_dir = os.path.join(dossier_path, f"{image}_extended")
                os.makedirs(output_dir, exist_ok=True)
                with ProcessPoolExecutor() as executor:
                    futures = [executor.submit(apply_transformations, combi, im, output_dir, i, h, l) for i, combi in enumerate(all_transform)]
                    for future in futures:
                        future.result() #Attendre la fin de chaque tâche
        if args.test_mode==1:
            break
        print(f'"{dossier}" done.')